message:
@T-Mobile:Mel bych pár dotazu:
1. Proc máte oddelene "Internet na cesty" a "Internet v mobilu" , když jde vlastne o 2 totožné služby? Není problém, použít místo modemu telefon, stejne jako není problém použít telefon jako hardwarový modem.
2. K cemu je tarif Internet v mobilu klasik, když je to jen Internet v mobilu standart s jedním 100MB balíckem FUPu navíc?
